import React from 'react';
import Amazon from './amazon';

import Tvf from './tvf';

const fseries = 'tvf';

const FavSSeries = () => {
  if (fseries === 'tvf') {
    return <Tvf />;
  } else {
    return <Amazon />;
  }
};

const App = () => (
  <>
    <h1 className='heading'>Best Web Series</h1>
    {/* <FavSSeries /> */}
    {FavSSeries === 'tvf' ? <Tvf /> : <Amazon />}
  </>
);

export default App;
